import React from 'react';

class Task extends React.Component {
    render(){
        return this.props.tasks.map(e => 
            <p key={e.id}>
              {e.title} - {e.descripcion} - {e.done} - {e.id}
            <input type="checkbox"></input>
            <button>x</button>
            </p>)
    }
}

export default Task;
